final _errors = <String>[
  '''XXX-host is unreachable''',
  '''Internal server error''',
  '''No connection''',
];

class FakeApi implements Api {

  final int _delay; //in millis
  final int _photosPerPage;
  final int _errorPossibility; //% of 100

  const FakeApi({int delay = 5000, photosPerPage = 30, int errorPossibility = 50}) :
      _delay = delay, _errorPossibility = errorPossibility, _photosPerPage = photosPerPage;

  @override
  Future<ApiResult>
  getPhotos(int page) async {
    print('\n\n[fake network] get photos, page: $page of ${_pages.length}, per page: $_photosPerPage, delay: $_delay millis, error possibility: $_errorPossibility%');
    try {
      final response = _process(
          Query(Uri.parse('fake://photos?page=$page&per_page$_photosPerPage'), page, _photosPerPage));
      return await Future.delayed(Duration(milliseconds: _delay),
          Random().nextInt(100) > _errorPossibility
              ? () => ApiResult.well(response, page == _pages.length)
              : () => throw _errors[Random().nextInt(_errors.length)]);
    } on String catch (msg) {
      print('handle msg $msg');
      return ApiResult.bad(msg);
    } catch (err, stackTrace) {
      print('handle error $err, $stackTrace');
      return ApiResult.bad(err.toString());
    }
  }

  Response
  _process(Query query) {
    print(' process, query: $query');
    assert(query.page <= _pages.length , 'No more data');
    final responseBody =  _pages[query.page-1];
    final jsonResponse = json.decode(responseBody);
    final data = jsonResponse as List;
    return Response(query,
                    data.map((item) => Foto.from(item, item['user'], item['urls'])),
                    rateLimit: 500,
                    rateLimitRemaining: 499
    );
  }

  @override
  dispose() {}

}
